const playerClick = (position) => {
    const set_p = position ;
    alert(set_p) ;
}




function PlayButton({position},{set_p})
{   
    return(
        <button className="play-btn" p={set_p} onClick={() => playerClick(position)} > {position} </button>
    )
}

export default PlayButton ;
